VALUES ('5204739611277', 'Frisco Yogourt glacé Nature Muesli', 'Yogourt, lait écrémé reconstitué, sucre, sirop de glucose, flocons d\'avoine, dextrose, inuline, lait maigre en poudre, crème, sirop de glucose-fructose, huile de tournesol, flocons de blé, sucre brun, noix de coco râpée, farine de riz, fruits rouges lyophilisés 0.2% (fraises, framboises), correcteur d\'acidité (acide lactique), émulsifiant (mono - et diglycérides d\'acides gras), farine de blé, stabilisants (farine de graines de guar, farine de graines de caroube), sel, malt, gluten de blé. Peut contenir des traces d\'oeufs, arachides, soja, autres fruits à coque et  sésame.', 'https://static.openfoodfacts.org/images/products/520/473/961/1277/front_fr.12.400.jpg', '4', '', '24.4', '', '', '3.9', '', '', '', '0');

